const USER_LOGIN = "USER_LOGIN";
const USER_LOGOUT = "USER_LOGOUT";
const USER_REGISTER = "USER_REGISTER";
const USER_TEST = "USER_TEST";
const FETCH_KITCHENS = "FETCH_KITCHENS";

export const userLogin = userdata => {
  return {
    type: USER_LOGIN,
    payload: {
      fullname: userdata.fullname,
      email: userdata.email,
      id: userdata.id
    }
  };
};

export const userLogout = () => {
  return {
    type: USER_LOGOUT,
    payload: {}
  };
};
export const userRegister = userdata => {
  return {
    type: USER_REGISTER,
    payload: {}
  };
};

export const userTest = userdata => {
  return {
    type: USER_TEST,
    payload: {
      userdata
    }
  };
};

export const kitchenFetch = kitchens => {
  return {
    type: FETCH_KITCHENS,
    payload: {
      kitchens
    }
  };
};

export const cartFetch = cartitems => {
  return {
    type: FETCH_CART,
    payload: {
      cartitems
    }
  };
};
